Kunal Avanti, Sunny Leone and Daniel Weber host a riveting afternoon at the launch of their new label, I Am Animal. Spotted at Earth Cafe, Bandra West, Kunal Avanti - Founder, I Am Animal and Sunny showcase the brand's first line- Collection Zero and delve into the ethos of the brand, and efforts to give back to the planet through conscious manufacture and consumption.

@iamanimalofficial is a PETA-approved cruelty-free brand that employs conscious 100% GOTS-Certified Organic fabrics to bring their superlative design sensibilities to life. Minimalist athleisure at its finest, I Am Animal advocates for minimalist living through effortless silhouettes, urging you to #FindYourOwnWay. The brand will also be donating 11% of their profits to various charities across the country to support animal welfare efforts on the ground.

